  function displayresults(name_list, url_list, instrutor_list, institution_list, intro_list) {
    var C0, C1, C2, C3;
    var fLen = name_list.length;
    const resultsContainer = document.getElementById('results');
  
    if (fLen === 0) {
      resultsContainer.innerHTML = '<H1>No results found.</H1>';
      return;
    }
  
    for (var i = 0; i < fLen; i++) {
      // Create the result frame element
      var resultFrame = document.createElement('div');
      resultFrame.setAttribute('class', 'result-frame');
  
      // Course name and link elements
      C0 = document.createElement('div');
      C0.setAttribute('class', 'coursename');
      C1 = document.createElement('H2');
      C2 = document.createElement('a');
      C2.setAttribute('class', 'a_coursename');
      C2.setAttribute('href', url_list[i]);
      C2.setAttribute('target', '_blank');
      C2.textContent = name_list[i];
      C1.appendChild(C2);
      C0.appendChild(C1);
      resultFrame.appendChild(C0);
  
      // Course link elements
      C0 = document.createElement('div');
      C0.setAttribute('class', 'courselink');
      C1 = document.createElement('p');
      C2 = document.createElement('a');
      C2.setAttribute('class', 'a_courselink');
      C2.setAttribute('href', url_list[i]);
      C2.setAttribute('target', '_blank');
      C3 = document.createElement('i');
      C3.textContent = url_list[i];
      C2.appendChild(C3);
      C1.appendChild(C2);
      C0.appendChild(C1);
      resultFrame.appendChild(C0);
  
      // Instructor and institution elements
      C0 = document.createElement('div');
      C0.setAttribute('class', 'instructor');
      C1 = document.createElement('span');
      C1.textContent = "Instructor: ";
      C0.appendChild(C1);
      C1 = document.createElement('i');
      C1.textContent = instrutor_list[i];
      C0.appendChild(C1);
      C1 = document.createElement('br');
      C0.appendChild(C1);
      C1 = document.createElement('span');
      C1.textContent = "Institution: ";
      C0.appendChild(C1);
      C1 = document.createElement('i');
      C1.textContent = institution_list[i];
      C0.appendChild(C1);
      resultFrame.appendChild(C0);
  
      // Course introduction elements
      C0 = document.createElement('div');
      C0.setAttribute('class', 'introduction');
      C1 = document.createElement('p');
      C1.textContent = intro_list[i];
      C0.appendChild(C1);
      resultFrame.appendChild(C0);
  
      // Append the result frame to the results container
      resultsContainer.appendChild(resultFrame);
    }
  }
